VALUES (currval(pg_get_serial_sequence('medical_documents', 'id')), 12, 'induce the development of new mechanisms and new blood vessels by increasing vascular permeability. FGF2 is a direct inducer of angiogenesis, which can promote the regeneration of epidermal cells and endothelial cells, induce the proliferation of vascular endothelial cells and detach them from the basement membrane, which in turn induce chemotaxis of endothelial cells towards breast variant cells. Herbs with liver soothing effect inhibit the proliferation of breast cells by downregulating the expression of angiogenic factors (VEGFA and FGF2), thereby improving pituitary and ovarian function, regulating endocrine function, and improving microcirculation and local blood circulation.', '{0.2816641926765442,0.5499781966209412,-0.283064067363739,0.09098134189844131,0.35721954703330994,0.09560313820838928,-0.09010465443134308,-0.02130049839615822,-0.4479248821735382,-0.04287387803196907,-0.06142710894346237,-0.2006167620420456,-0.6717640161514282,-0.35861778259277344,0.05067652463912964,-0.1988259106874466,-0.1907242238521576,0.019457178190350533,0.19614119827747345,0.06769099831581116,-0.5068617463111877,0.024939196184277534,-0.40859222412109375,0.1648373305797577,-0.43113070726394653,-0.0959535539150238,-0.49182572960853577,-0.12419529259204865,-0.11914169043302536,-1.1030819416046143,0.023066598922014236,0.6965349912643433,0.31390056014060974,0.9572831392288208,0.44903841614723206,0.03311046585440636,-0.28841590881347656,0.5515459775924683,0.5514470934867859,-0.23183825612068176,0.538733184337616,-1.0755879878997803,-0.14305929839611053,-0.574923038482666,0.19015906751155853,-0.3137957751750946,-0.07787508517503738,-0.21218861639499664,-0.1361781805753708,-0.3296937346458435,0.3629014492034912,-0.316550612449646,0.3285406529903412,0.3619907796382904,0.21216703951358795,-0.20121321082115173,-0.03665400668978691,0.044195402413606644,0.8395563364028931,0.4328600764274597,-0.039488181471824646,0.37193