VALUES (currval(pg_get_serial_sequence('medical_documents', 'id')), 29, ', neosafflower glycoside, Safflower oil chlorogenic acid, caffeic acid, catechol, pyrocatechol, etc. Safflower can dilate arteries, prevent coagulation and thrombus, increase coronary blood flow and myocardial nutrient blood flow, inhibit platelet aggregation, enhance fibrinolysis, and reduce WBV. Safflower flavin has inhibitory effects on ADP-induced platelet aggregation, as well as deaggregation on ADP-aggregated platelets. Safflower flavin can significantly prolong plasma calcium recovery time, PT and coagulation time. It also affects the coagulation system in vivo and in vitro, and has very significant inhibitory effects on thrombus, which can improve microcirculation, protect against inflammation and platelet aggregation, as well as effectively enhance the bodys cellular immunity, humoral immunity and nonspecific immune function. Safflower oil also has the effect of reducing blood lipids.', '{-0.02402985654771328,0.6459099054336548,-0.41388019919395447,0.3959263563156128,0.38037118315696716,0.02359459549188614,0.05404166877269745,0.7880540490150452,-0.6569613218307495,-0.5750898718833923,-0.0685749351978302,1.1746762990951538,-0.236850306391716,-0.3409242033958435,0.6794643998146057,-0.5945497751235962,0.979968249797821,0.24701561033725739,-0.6998863220214844,0.5138843655586243,-0.29997164011001587,0.30113622546195984,-0.18765902519226074,-0.3257282078266144,0.3559178411960602,-0.03614674136042595,-0.24477727711200714,0.5726982355117798,0.19224750995635986,-0.4182024300098419,0.45573103427886963,0.17912061512470245,-0.953911542892456,0.03413549065589905,0.3059130012989044,-0.15160255134105682,-0.23598703742027283,0.17258606851100922,-0.7845101952552795,0.12535466253757477,0.5347920656204224,-0.3572402000427246,-0.06550487130880356,-0.44388753175735474,0.5537213683128357,-0.6956563591957092,-0.1759205162525177,-0.293197363615036,0.4794061481952667,0.2644982635974884,0.4215010702610016,0.248