VALUES (currval(pg_get_serial_sequence('medical_documents', 'id')), 35, 'cell growth, causing cytotoxicity, increasing oxidative stress, and blocking cell cycle progression. Kaempferol is associated with multiple signaling pathways, such as the EGFR (Epidermal Growth Factor Receptor)/PI3K/Akt, and Notch1 (Neurogenic locus notch homolog protein 1)/PI3K/Akst pathways, upregulates proapoptotic proteins BAX and CASP3, downregulates antiapoptotic protein BCL2, thereby blocking cell cycle and promoting cell apoptosis. Kaempferol can also significantly reduce the expression of interleukin 6 and interleukin 1B, and exhibits a dose dependence, thereby alleviating the degree of breast hyperplasia.', '{-0.3319089114665985,0.11431050300598145,0.17423130571842194,0.029485467821359634,0.3627541661262512,0.38416820764541626,-0.5934672951698303,0.28925809264183044,0.22466090321540833,0.3466624617576599,-0.2421821504831314,0.24335232377052307,-0.7293620705604553,-0.499805212020874,0.375190407037735,0.028657494112849236,-0.5741302371025085,-0.07633691281080246,0.34972915053367615,-0.8535101413726807,-0.07654881477355957,0.07956646382808685,-0.033815912902355194,-0.2142883539199829,-0.2844092547893524,0.18158067762851715,-0.2731085419654846,0.4864366352558136,0.5317469835281372,0.0353877879679203,-0.041471220552921295,0.48986539244651794,0.4643605351448059,-0.27383095026016235,0.6607819199562073,0.1644170731306076,-0.5838477611541748,-0.18988274037837982,-0.010026426054537296,0.3598559498786926,0.7014319896697998,-0.5991926789283752,0.13939501345157623,0.16577693819999695,0.541791558265686,-0.978771448135376,0.40245798230171204,-0.0796535536646843,0.3868500292301178,-0.3880459666252136,0.6769565939903259,0.5533555150032043,-0.3669643998146057,0.5856843590736389,0.7984139919281006,-0.28937941789627075,-0.3356165289878845,-0.21244727075099945,-0.20936177670955658,0.2189691811800003,0.8542255759239197,0.3522389233112335,0.5969974398612976,0.10887859016656876,-0.20602640509605408,0.398727