INSERT INTO medical_documents (title, content, source, topic, url, document_type, metadata, content_length)
VALUES ('Adult Height Following Prepubertal Treatment With Antiandrogen, Aromatase Inhibitor, and Reduced Hydrocortisone in CAH', 'Height outcome in patients with classic congenital adrenal hyperplasia (CAH) is suboptimal due to glucocorticoid and androgen excess. In an open, randomized, controlled trial, children with classic CAH were randomized to receive a combination regimen of antiandrogen, aromatase inhibitor, reduced hydrocortisone, and fludrocortisone prior to puberty or standard therapy (hydrocortisone, fludrocortisone). Females continued on antiandrogen during puberty. The primary endpoint was adult height. Of 62 children randomized, 45 completed the study. Adult height SDS did not differ between the investigational and control groups (0.34 [0.93] vs 0.60 [0.89], respectively), mean difference 0.26 [95% CI 0.29, 0.82],  Prepubertal antiandrogen, aromatase inhibitor combination with reduced hydrocortisone improves short-term predicted height for children with CAH but does not result in taller adult stature than those treated with standard therapy, and is not recommended. Females may benefit from antiandrogen treatment during puberty.', 'PubMed_Central', 'nutrition_therapy', 'https://www.ncbi.nlm.nih.gov/pmc/', 'research_article', '{"content_hash": "a2ba6984cc92fe5f", "embedding_date": "2025-06-25T14:49:32.218563", "scraper_source": "PubMed_Central", "category": "research_literature", "subcategory": "pubmed_central", "document_type": "research_article", "published_date": "", "original_url": "https://www.ncbi.nlm.nih.gov/pmc/"}', 1032);

