VALUES (currval(pg_get_serial_sequence('medical_documents', 'id')), 1, 'd cerebrovascular safety of CGRP-targeted migraine treatmentsan area of growing clinical relevance. We compare these newer agents with traditional migraine preventives and highlight the paucity of data in patients with previous stroke, subarachnoid hemorrhage, myocardial infarction, or significant CV comorbidities. In addition, we discuss the emerging topic of dual CGRP pathway blockade (mAbs plus gepants), which has not previously been reviewed in the context of vascular risk. Based on currently available scientific evidence, we offer structured clinical considerations to guide the use of CGRP-targeted therapies in patients with vascular risk or cerebrovascular disease. Our aim is to support informed decision making in a population that has often been excluded from clinical trials but is becoming increasingly important in clinical practice. Migraine is the second most prevalent debilitating disorder among young individuals.', '{0.21397307515144348,0.06458363682031631,-0.06668869405984879,-0.724133312702179,0.2868213653564453,-0.18815459311008453,0.31733977794647217,-0.3413017988204956,0.003281082957983017,-0.9628771543502808,-0.33762243390083313,0.25554710626602173,0.04298939183354378,-0.4752207100391388,-0.706084668636322,0.2511773109436035,-0.07547925412654877,0.12994146347045898,-0.42203575372695923,0.22225452959537506,-0.7213848829269409,0.07826714217662811,0.03026260808110237,0.33899426460266113,0.1557832956314087,0.051475487649440765,-0.28487056493759155,-0.20127037167549133,-0.04707403853535652,-0.3701774775981903,-0.20435462892055511,-0.10962570458650589,0.4824419319629669,-0.42709261178970337,-0.4978253245353699,-0.10196617990732193,-0.21413928270339966,1.9635303020477295,-0.43985646963119507,0.022644540295004845,0.6369921565055847,1.0659611225128174,-0.11817003786563873,-0.09353422373533249,0.4299410283565521,0.15693292021751404,-0.12126075476408005,1.0054025650024414,0.33043637871742