VALUES (currval(pg_get_serial_sequence('medical_documents', 'id')), 2, 'nical practice. Migraine is the second most prevalent debilitating disorder among young individuals. Stroke is the second leading cause of death worldwide and the leading cause of long-term disability. Approximately two-thirds of all strokes are ischemic, and one-third is hemorrhagic. Shared Risk Factors of Stroke and Migraine Abbreviations: CRP = C-reactive protein;

