VALUES (currval(pg_get_serial_sequence('medical_documents', 'id')), 4, 'ectly interact with the CGRP receptor by binding one of the subunits of the canonical CGRP receptor. In comparison with mAbs, gepants show a by far shorter half-life (from 5 to 11 hours) and can be used for acute migraine treatment and/or preventative migraine treatment. Atogepant and rimegepant are approved for preventive migraine treatment. Notably, rimegepant can be used as acute migraine and preventive migraine medication. Rimegepant for preventive use is taken every other day while atogepant is taken daily. Ubrogepant and rimegepant for acute migraine use should be taken similar to triptans. Zavegepant is the first gepant that is applied nasally for acute migraine attack termination. In healthy participants, mAbs cannot penetrate the BBB to a relevant amount, which is due to their high molecular weight.', '{0.3055737018585205,0.6420595645904541,-0.08905990421772003,-0.5271086692810059,0.006601161323487759,0.13971561193466187,-0.3003658354282379,-0.15531134605407715,-0.2630113661289215,-0.8785127401351929,-0.34022924304008484,0.4315023124217987,0.646144688129425,-0.04446517676115036,-0.5505521297454834,0.0017949504544958472,0.10158621519804001,-0.0343010276556015,-0.2852248549461365,0.197153240442276,-0.8520785570144653,-0.13458673655986786,-0.21342408657073975,0.05919184163212776,0.5685020685195923,0.06513313949108124,-0.12450756132602692,-0.0942428931593895,-0.37100693583488464,0.14446352422237396,-0.3892372250556946,-0.03127087652683258,-0.03528650477528572,0.6391430497169495,-0.48251044750213623,-0.27158257365226746,-0.2524043917655945,1.5528593063354492,-0.1578778624534607,-0.5155750513076782,0.5239629745483398,1.792000651359558,-0.26315730810165405,0.19272026419639587,0.04809455946087837,-0.25740841031074524,-0.3665241599082947,0.5419273376464844,0.46171221137046814,-0.37151506543159485,-0.04205041006207466,-0.4846932590007782,-0.7771929502487183,0.29668566584587097,-1.0556247234344482