VALUES (currval(pg_get_serial_sequence('medical_documents', 'id')), 7, 't approved targeted migraine therapies, study data beyond comprehensive approval studies are scarce. In a randomized, placebo-controlled, double-blind crossover study with 22 healthy male volunteers, no vasoconstrictive effect of telcagepant was identified, when the participants were orally administered 500 mg of telcagepant (representing the second highest dose of telcagepant studied in RCTs) or placebo. In phase 3 trials for atogepant, rimegepant, and ubrogepant, no increase in CV AEs among treated patients have been reported. Selected Meta-Analyses and Clinical and Preclinical Trials Evaluating the Efficacy and Safety of Monoclonal Antibodies and Gepants in Migraine Treatment Abbreviations: AE = adverse event;

