VALUES (currval(pg_get_serial_sequence('medical_documents', 'id')), 9, 've triptans or nonsteroidal anti-inflammatory drugs (NSAIDs) is safe in RCTs and in real-world data. However, preclinical studies have indicated an elevated risk for individuals under CGRP-targeted therapies and acute vascular events, such as stroke, at least in animal models. Because these treatments have been emerging over the past 5 years and might become the first-line treatment in patients with migraine, careful evaluation of CV safety in patients need to be studied further. The 3 case reports described above do not prove direct causality between stroke or RCVS and CGRP-interfering treatment. However, it is crucial to consider the implications for patients using these migraine preventive therapies in acute stroke settings. It has been proposed that CGRP blockage may affect cerebral hemodynamics in clinical responders to mAb preventive treatment, with lower cerebral blood-flow velocity (a marker for decreased CBF) observed in this subgroup.', '{0.4986928105354309,0.36589333415031433,0.028415337204933167,-0.43794068694114685,0.2568102478981018,-0.0944082960486412,0.2865184545516968,-0.6821019053459167,0.16088464856147766,-1.2537424564361572,-0.23249246180057526,0.22983357310295105,-0.04751484468579292,-0.6512568593025208,-0.3897688388824463,0.031725138425827026,-0.01935468055307865,-0.03681565076112747,-0.07778878509998322,-0.20637643337249756,-0.8437103033065796,-0.044985029846429825,0.22871191799640656,0.2717586159706116,0.2998720109462738,0.16509512066841125,-0.14583523571491241,-0.2608177065849304,0.09432229399681091,-0.059497177600860596,-0.2090139389038086,0.2611085772514343,-0.08666422963142395,-0.06701502948999405,-0.25298047065734863,-0.4149359166622162,-0.28112736344337463,1.8044716119766235,0.1543375551700592,0.0832502543926239,0.5720527172088623,0.955189049243927,-0.12219428271055222,-0.033215612173080444,0.2223881334066391,-0.08155137300491333,-0.6495662331581116,0.70362520217895